import React, { useState } from 'react';
import EventCreator from './EventCreator';
import axios from 'axios';

const App = () => {
  const [newEvent, setNewEvent] = useState({});

  const handleSubmit = (newEvent) => {
    // Create a new event using the API
    axios.post('/create_event/', newEvent)
      .then(response => {
        console.log('Event created successfully!');
        // You can also redirect to the event list page here
        // window.location.href = '/event_list/';
      })
      .catch(error => {
        console.error(error);
      });
  };

  return (
    <div>
      <EventCreator onSubmit={handleSubmit} />
    </div>
  );
};

export default App;
